import React from 'react';
import logo from './logo.svg';
import './App.css';
import HeaderComponent from './components/HeaderComponent'
import FooterComponent from './components/FooterComponent'

function App() {
  return (
    <div className="App">
      <header className="App-header">

      <HeaderComponent/>

      <FooterComponent/>

      </header>
    </div>
  );
}

export default App;
